import { useSelector } from "react-redux";

const Create = () => {
    useSelector
    return (
        <>
            <div className="container-fluid d-flex flex-column justify-content-center align-items-center" style={{ height: '80vh'}}>
                <div className="d-flex flex-column w-50 card py-4 px-3 position-relative">
                    <div className="w-100 ribbon rounded-top"></div>
                    <input type="text" className="text mb-3" placeholder="Untitled Form" />
                    <input type="text" className="text mb-2" placeholder="Description" />
                </div>
                <button className="btn btn-outline-dark mt-2">Create</button>
            </div>
        </>
    );
}
export default Create;
